import React from "react";

function Footer() {
  return (
    <footer
      id="sticky-footer"
      className="py-4 bg-light text-black-50 fixed-bottom"
    >
      <div className="container text-center">
        <small>Copyright &copy; Your Website</small>
      </div>
    </footer>
  );
}

export default Footer;
